import React, {useState} from 'react';
import './styles.css';
import Person from './Person';
interface Props {

}

interface State{
    people: Person[],
}

const Results: React.FC = () => {
    const [people, setPeople] = useState([])
    const getAll = () => {
        //make api call
        //sample objects
        const samples = [
            {
                firstName: 'Mason',
                lastName: 'Heaman',
                occupation: 'SWE',
                age: '21'
            },
            {
                firstName: 'Nicole',
                lastName: 'Lynch',
                occupation: 'Nail Tech',
                age: '21'
            }
        ];
        setPeople(samples)
        return;
    }
  return (
    <div>
        <h2 className='result_header'>Results</h2>
        <button onClick={() => getAll()}>Refresh</button>
        <ul className='result_container'>
            {getAll().map(person => {
                return(
                    <li className='result'>{`${person.firstName} ${person.lastName}, ${person.age}, ${person.occupation}`}</li>
            )})}
        </ul>
    </div>
  )
}

export default Results
